    let adj = 1.62;
    if (idx == 1) {
        let ang = 30;
        for (let i = 0; i<12; i++) {
            let tang = ang*(i+3);  //? (i+3) for 4Am bottom)
            mx = rad * adj * Math.cos(toRadians(tang))
